  var hourDeg   = now.getHours() / 12 * 360 + now.getMinutes() / 60 * 30;
  var minuteDeg = now.getMinutes() / 60 * 360 + now.getSeconds() / 60 * 6;
  var secondDeg = now.getSeconds() / 60 * 360;
