      zeroHour = (APhour <10 ? '0' : '')+APhour,
      minute = (now.getMinutes() < 10 ? '0' : '') + now.getMinutes(),
      format = hour >= 12 ? 'PM' : 'AM',
      showtime = zeroHour + ':' + minute + format;
